%%================================
'enc_NonStandardIdentifier'(Val) ->
    'enc_NonStandardIdentifier'(Val, []).


'enc_NonStandardIdentifier'({'NonStandardIdentifier',Val}, TagIn) ->
   'enc_NonStandardIdentifier'(Val, TagIn);

'enc_NonStandardIdentifier'(Val, TagIn) ->
   {EncBytes,EncLen} = case element(1,Val) of
      object ->
         ?RT_BER:encode_object_identifier(element(2,Val), [<<128>>]);
      h221NonStandard ->
         'enc_H221NonStandard'(element(2,Val), [<<161>>]);
      experimental ->
         ?RT_BER:encode_restricted_string([], element(2,Val), 22, [<<130>>]);
      Else -> 
         exit({error,{asn1,{invalid_choice_type,Else}}})
   end,

?RT_BER:encode_tags(TagIn, EncBytes, EncLen).




'dec_NonStandardIdentifier'(Tlv) ->
   'dec_NonStandardIdentifier'(Tlv, []).

'dec_NonStandardIdentifier'(Tlv, TagIn) ->
Tlv1 = ?RT_BER:match_tags(Tlv,TagIn), 
case (case Tlv1 of [CtempTlv1] -> CtempTlv1; _ -> Tlv1 end) of

%% 'object'
    {131072, V1} -> 
        {object, ?RT_BER:decode_object_identifier(V1,[])};


%% 'h221NonStandard'
    {131073, V1} -> 
        {h221NonStandard, 'dec_H221NonStandard'(V1, [])};


%% 'experimental'
    {131074, V1} -> 
        {experimental, ?RT_BER:decode_restricted_string(V1,8,22,[])};

      Else -> 
         {asn1_ExtAlt, ?RT_BER:encode(Else)}
   end
.


